import React from "react";

class Menu extends React.Component {

  render() {
    return (
      <div class="topnav">
	<head>
  	<link rel="stylesheet" href="Menu.css"/>
	</head>
  	<a class="active" href="#home">Home</a>
  	<a href="#news">News</a>
  	<a href="#contact">Contact</a>
  	<a href="#about">About</a>
  	<input type="text" placeholder="Search.."/>
      </div>
    );
  }
};

export default Menu;
